import React from 'react';
import { Link } from 'react-router-dom';

export default function ArticleNavgation() {
    return (
        <div>
            <div className="article_navigation">
                <span className="logo"></span>
            </div>
            <div className="article_sub_navigation">
                <ul>
                    <li id="selected"><Link to="/article/contents">HOT 10</Link></li>
                    <li id="selected"><Link to="/article/contents">Latest</Link></li>
                    <li id="selected"><Link to="/article/contents">Nutrition</Link></li>
                    <li id="selected"><Link to="/article/contents">Health</Link></li>
                    <li id="selected"><Link to="/article/contents">Beauty</Link></li>
                </ul>
            </div>
        </div>
    )

}
